  uint256(:public, :maxSupply)
  uint256(:public, :perMintLimit)
  constructor(name: :string, symbol: :string, maxSupply: :uint256, perMintLimit: :uint256, decimals: :uint8) {
    self.ERC20.constructor(name: name, symbol: symbol, decimals: decimals)
    s.maxSupply=maxSupply
    s.perMintLimit=perMintLimit
  }
  function(:mint, { amount: :uint256 }, :public) {
