contract(:ERC20, abstract: true) {
  event(:Transfer, { from: :address, to: :address, amount: :uint256 })
  event(:Approval, { owner: :address, spender: :address, amount: :uint256 })
  string(:public, :name)
  string(:public, :symbol)
  uint8(:public, :decimals)
  uint256(:public, :totalSupply)
  mapping(({ address: :uint256 }), :public, :balanceOf)
  mapping(({ address: mapping(address: :uint256) }), :public, :allowance)
  constructor(name: :string, symbol: :string, decimals: :uint8) {
    s.name=name
    s.symbol=symbol
    s.decimals=decimals
  }
  function(:approve, { spender: :address, amount: :uint256 }, :public, :virtual, returns: :bool) {
    s.allowance[msg.sender][spender] = amount
    emit(:Approval, owner: msg.sender, spender: spender, amount: amount)
    return true
  }
  function(:transfer, { to: :address, amount: :uint256 }, :public, :virtual, returns: :bool) {
    require(s.balanceOf[msg.sender] >= amount, "Insufficient balance")
    s.balanceOf[msg.sender] -= amount
    s.balanceOf[to] += amount
    emit(:Transfer, from: msg.sender, to: to, amount: amount)
    return true
  }
  function(:transferFrom, { from: :address, to: :address, amount: :uint256 }, :public, :virtual, returns: :bool) {
    allowed = s.allowance[from][msg.sender]
    require(s.balanceOf[from] >= amount, "Insufficient balance")
    require(allowed >= amount, "Insufficient allowance")
    s.allowance[from][msg.sender] = allowed - amount
    s.balanceOf[from] -= amount
    s.balanceOf[to] += amount
    emit(:Transfer, from: from, to: to, amount: amount)
    return true
  }
  function(:_mint, { to: :address, amount: :uint256 }, :internal, :virtual) {
    s.totalSupply += amount
    s.balanceOf[to] += amount
    emit(:Transfer, from: address(0), to: to, amount: amount)
  }
  function(:_burn, { from: :address, amount: :uint256 }, :internal, :virtual) {
    require(s.balanceOf[from] >= amount, "Insufficient balance")
    s.balanceOf[from] -= amount
    s.totalSupply -= amount
    emit(:Transfer, from: from, to: address(0), amount: amount)
  }
}
contract(:Ownable, abstract: true) {
  address(:public, :owner)
  event(:OwnershipTransferred, { previousOwner: :address, newOwner: :address })
  constructor(owner: :address) {
    s.owner=owner
  }
  function(:transferOwnership, { newOwner: :address }, :public) {
    onlyOwner!
    previousOwner = s.owner
    s.owner=newOwner
    emit(:OwnershipTransferred, previousOwner: previousOwner, newOwner: newOwner)
  }
  function(:onlyOwner!, :internal) {
    require(msg.sender == s.owner, "msg.sender is not the owner")
  }
}
contract(:AirdropERC20, is: [:ERC20, :Ownable]) {
  uint256(:public, :maxSupply)
  uint256(:public, :perMintLimit)
  uint256(:public, :singleTxAirdropLimit)
  constructor(name: :string, symbol: :string, owner: :address, maxSupply: :uint256, perMintLimit: :uint256, decimals: :uint8) {
    self.ERC20.constructor(name: name, symbol: symbol, decimals: decimals)
    self.Ownable.constructor(owner: owner)
    s.maxSupply=maxSupply
    s.perMintLimit=perMintLimit
    s.singleTxAirdropLimit=10
  }
  function(:airdrop, { to: :address, amount: :uint256 }, :public) {
    onlyOwner!
    require(amount > 0, "Amount must be positive")
    require(amount <= s.perMintLimit, "Exceeded mint limit")
    require(s.totalSupply + amount <= s.maxSupply, "Exceeded max supply")
    _mint(to: to, amount: amount)
  }
  function(:airdropMultiple, { addresses: [:address], amounts: [:uint256] }, :public) {
    onlyOwner!
    require(addresses.length == amounts.length, "Address and amount arrays must be the same length")
    require(addresses.length <= s.singleTxAirdropLimit, "Cannot import more than 10 addresses at a time")
    forLoop(condition: ->(i) {
      i < addresses.length
    }, max_iterations: s.singleTxAirdropLimit) { |i|
      to = addresses[i]
      amount = amounts[i]
      airdrop(to: to, amount: amount)
    }
  }
  function(:burn, { amount: :uint256 }, :public) {
    _burn(from: msg.sender, amount: amount)
  }
}
